import React from "react";
import Aboutme from "./aboutimage.png";
function About() {
  return (
    <div>
      <div class="row align-items-center">
        <div class="col-md-8">One of three columns</div>
        <div class="col-md-4">
          <img src={Aboutme} alt="Coding Vector" />
        </div>
      </div>
    </div>
  );
}

export default About;
